import { Box } from "@chakra-ui/layout";
const Task = (props) => {
  const { taskvalue, task } = props;
  const remove = () => {
    console.log(task);
    task.remove(task.indexOf(taskvalue));
    console.log(task);
  };
  return (
    <Box bg="red" mx={3} onClick={() => remove()} px={2}>
      just test
    </Box>
  );
};
export default Task;
